import React from 'react';
import logoImg from '../../images/logo_place_header.svg';
import '../../index.css';
import { Link } from "react-router-dom";
import Login from "../Login";
import Register from "../Register";

export default function Header({ loggedIn }) {
    return(
        <header className="header">
            <img src={logoImg} alt="лого Место" className="logo" />
            {loggedIn ?
                <div className="header__auth">
                    <p className="header__auth-email">email</p>
                    <Link to="/sign-in" className="header__auth-logout">Выход</Link>
                </div>
                : (
                    <Register/> ? <Link to="/sign-up" className="header__auth">Регистрация</Link> : <Link to="/sign-in" className="header__auth">Войти</Link>
                )
            }
        </header>
    )
}
